  <div>
    <Switch>
      {console.log(match)}
      <Route exact path={`${match.path}`}component={CollectionOverview}/>
     
      <Route path={`${match.path}/:categoryId`} >
        <h1>jjjjj</h1>
     </Route>
    </Switch>
  </div>
);

export default ShopPage;
